import React from 'react';
import { Link } from 'react-router-dom';
import Banner from './Components/Banner/Banner';
import './App.css'

const Home = () => {
    return (
        <>
            <div>
                <Banner
                    pageTitle={' Abdelbasset BABEKER'}
                    subtitle={'Welcom To my Profile Homepage '}
                />
                <div id='homePage'>
                    <Link to={'/blogs'}>
                        <div className='cards'>
                            <h1>Blogs</h1>
                        </div>
                    </Link>
                    <Link to={'/contacts'}>
                        <div className='cards'>
                            <h1>Contacts</h1>
                        </div>
                    </Link>
                </div>
            </div>
        </>
    );
}

export default Home;
